import * as React from 'react';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import { useStyles } from "./Style";
import { border, borderColor, fontFamily } from '@mui/system';



export default function FormDialog() {

    const classes = useStyles(); 

  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div>
      {/* <Button variant="outlined" onClick={handleClickOpen}>
        Open form dialog
      </Button> */}

      <Button className={classes.buttop} variant = "contained" color = "error" 
      onClick={handleClickOpen}>Sign In</Button>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle className ={classes.subscription}
        // style={{fontSize : '25px' ,color : "white" ,textAlign : 'center', backgroundColor : 'red' ,fontFamily: 'Roboto' }}
        >SUBSCRIPTION</DialogTitle>
        <DialogContent>
          {/* <DialogContentText>
            To subscribe to this website, please enter your email address here. We
            will send updates occasionally.
          </DialogContentText> */}
          <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Email Address"
            type="email"
            fullWidth
            variant="standard"
          />
          <TextField
            margin="dense"
            id="name"
            label="Password"
            type="password"
            fullWidth
            variant="standard"
          />
        </DialogContent>
        <DialogActions>

          <Button>Register</Button>
          <Button>LogIn</Button>
          <Button>Logout</Button>
          {/* <Button onClick={handleClose}>Cancel</Button> */}

        </DialogActions>
      </Dialog>
    </div>
  );
}
